import React from 'react';
import { Pagination } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';

function Paginate({ pages, page, keyword = '', isAdmin = false }) {
    if (keyword) {
        keyword = keyword.split('?keyword=')[1].split('&')[0];
    }

    console.log('Current Page:', page); // Debugging line
    console.log('Total Pages:', pages); // Debugging line

    return (
        pages > 1 && (
            <Pagination>
                {[...Array(pages).keys()].map((x) => {
                    const isActive = page === x + 1;
                    console.log(`Page ${x + 1} is ${isActive ? 'active' : 'inactive'}`); // Debugging line
                    return (
                        <LinkContainer
                            key={x + 1}
                            to={{
                                pathname: !isAdmin ? '/' : '/admin/productlist',
                                search: `?keyword=${keyword}&page=${x + 1}`,
                            }}
                        >
                            <Pagination.Item active={isActive}>
                                {x + 1}
                            </Pagination.Item>
                        </LinkContainer>
                    );
                })}
            </Pagination>
        )
    );
}

export default Paginate;
